import { HomeRounded, LocalOfferRounded, AccountCircleRounded, ShoppingCartRounded } from "@material-ui/icons";

const HeaderMenu = [{ id: 1, navLink_text: "Home", navLink_icon: HomeRounded, navLink_path: "/" }, {
    id: 2, navLink_text: "Offers", navLink_icon: LocalOfferRounded, navLink_path: "/offers"
}, {
    id: 3, navLink_text: "Account", navLink_icon: AccountCircleRounded
}, { id: 4, navLink_text: "Cart", navLink_icon: ShoppingCartRounded }];

export default HeaderMenu;
